execution.script:
import groovy.transform.Field
import groovy.json.JsonSlurper
import java.io.IOException;
import java.util.Arrays;
import java.util.ArrayList;
import java.util.Collections;
import java.util.Iterator;
import java.util.List;
import java.io.File; 

@Field def fprList = []
@Field def credentials = "hidraxos_credentials"
@Field def ip = "192.168.1.110"
@Field def labelParameters = []

node('master'){
    parameters{
            choice(name: 'NAMES', choices: getFPRS())
            booleanParam(name:'Refresh_Param',description: '', defaultValue: false)
            string(name:'Archivo',description: "nombre del archivo .json con la info")
            string(name:'File',description:'')
    }
    properties([parameters(labelParameters)])

    stage('println'){
        println fprList
    }
}
def getFPRS(){
    withCredentials([usernamePassword(credentialsId: credentials, passwordVariable: 'PASS', usernameVariable: 'USER')]) {
        sh"""
            sshpass -p ${PASS} ssh ${USER}@${ip} ls /home/hidraxos/Escritorio/Ejercicios/Groovy > versiones.txt
        """
    }
    fprList = readFile("versiones.txt").readLines()
    return fprList
}
